import React from "react";

function Skills() {
  return (
    <div>
      <h1>Skills</h1>
      <ol>
        <li className="items">
          <h2>Front-End</h2>
          <span></span>
        </li>
        <li className="items">
          <h2>Back-End</h2>
          <span></span>
        </li>
        <li className="items">
          <h2>Languages</h2>
          <span></span>
        </li>
      </ol>
    </div>
  );
}

export default Skills;
